import React from 'react'

const Skills = (props) => {

    const {skills, attributes} = props

    console.log(skills)



    return (
        <>
        <h2>Skills:</h2>
        <h3>Total Points</h3>
        {skills.map((skill) => (
            <div key={skill.name}>{skill.name} - 
            points: 0
            &nbsp;
            <button>+</button>
            &nbsp;
            <button>-</button>
            &nbsp;
            modifier: 0
            total: 0
            </div>
        ))}
        </>

    )
}

export default Skills
